import axios from "axios";

const api = () => {
    var hostname = "/api/1.0"
    function getMovies(){
        return axios(`${this.hostname}/movie/get`).then(
          (response) => response.json()
        );
    }



};
export default {
    hostname: "/api/1.0",
    getMovies: () => {
      return axios('https://xxx.api/article')
